    date contribution total due to a refund that was actually disbursed and disclosed
    on 08/02/2012.  The Committee has removed the MEMO from this report and moved
    it to the September Monthly report to correspond to the refund reported on Schedule
    B for Line 28(a).  Please note that the employees that were disclosed on Schedule
    H4 and Schedule B supporting Line 21(b) as payroll spent less than 25% of their
